import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom'

import Home from '../views/Home'
import About from '../views/About'

function Router(props) {
    return (
        <BrowserRouter>
            <Switch>
                <Route exact path='/'>
                    <Home/>
                </Route>
                <Route path='/about'>
                    <About/>
                </Route>
            </Switch>
        </BrowserRouter>
    );
}

export default Router;
